using Game.UI;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using UnityEngine;

namespace Game.Tests
{
    public class MsgBoxTester : MonoBehaviour
    {
        private void Start()
        {
            Test();
        }

        public void Test()
        {
            MsgBox.Create("Notification1", (msgbox) =>
            {
                msgbox.Title = "测试通知1";
                msgbox.Message = "";
                msgbox.OnConfirm += () => Debug.Log("点击确认");
                msgbox.OnCancel += () => Debug.Log("点击取消");
                msgbox.Type = MsgboxType.ConfirmAndCancel;
                msgbox.ShowCloseButton = true;
            });
            MsgBox.Create("Notification2", (msgbox) =>
            {
                msgbox.Title = "测试通知2";
                msgbox.Message = "";
                msgbox.OnConfirm += () => Debug.Log("点击确认");
                msgbox.OnCancel += () => Debug.Log("点击取消");
                msgbox.Type = MsgboxType.Confirm;
                msgbox.ShowCloseButton = false;
            });
        }
    }
}
